css:
@-moz-document domain("youtube.com") {
/* Watched badge */

/*[[test]]*/

ytd-thumbnail-overlay-time-status-renderer {
    z-index: 5;
    opacity: 1;
    transition: opacity 0.3s
}
ytd-thumbnail:hover ytd-thumbnail-overlay-time-status-renderer {
    opacity: 0;
}

#progress.ytd-thumbnail-overlay-resume-playback-renderer {
    background: no-repeat url(data:image/png;base64,);
    opacity: 0.95;
    width: 100% !important;
    height: 100% !important;
    background-size: 80% 80%;
/*[[crest]]*/
    pointer-events: none;
    position: absolute;
}

ytd-thumbnail:hover ytd-thumbnail-overlay-resume-playback-renderer {
    display:none;
}

/* Removing original small watched label */
ytd-thumbnail-overlay-playback-status-renderer {
    display: none;
}
}
